import React from 'react';
import { Link } from 'react-router-dom';

export const ItinerariesPage = () => {
    return (
        <>
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/itineraries">Itineraries</Link></li>
                <li><Link to="/locations">Locations</Link></li>
            </ul>
            Itineraries
        </>
    )

};
